Short description:
State-of-the-Art designs make the new DF20A the most technically advanced portable outboard on the market today.  This is the world's first 20 hp outboard motor designed with Lean Burn and Battery-Less Electronic Fuel Injection. The Suzuki EFI system operates Battery-Less, which is an industry first in this horse-power class. The DF20A is a smooth running "Next Generation" four stroke which delivers quick starts, great accelleration, awesome performance and superior fuel economy. Go Lean, Clean and Green, Go Suzuki!

&lt;strong&gt;MAXIMIZING FUEL ECONOMY AND PERFORMANCE&lt;/strong&gt;

Suzuki's Lean Burn Control Technology optimises the fuel-to-air mixture throughout the engine's operating range to help maximise performance and fuel economy.

